<!DOCTYPE html>
<html lang="en">

<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>South Asian Performing Arts</title>
    <script src="https://d3js.org/d3.v7.min.js"></script>
    <link href="https://fonts.googleapis.com/css2?family=Inter:wght@300;400;500;600&display=swap" rel="stylesheet">
    <style>
        * {
            box-sizing: border-box;
        }

        :root {
            --bg-color: #ffffff;
            --chat-bg: #ffffff;
            --user-msg-bg: #f4f4f4;
            --bot-msg-bg: #ffffff;
            --text-primary: #1a1a1a;
            --text-secondary: #666666;
            --border-color: #eaeaea;
            --accent-color: #000000;
            --input-bg: #ffffff;
            --font-family: 'Courier New', Courier, monospace;
            --max-width: 800px;
        }

        body {
            margin: 0;
            padding: 0;
            background-color: var(--bg-color);
            font-family: var(--font-family);
            color: var(--text-primary);
            height: 100vh;
            width: 100vw;
            display: flex;
            flex-direction: column;
            overflow: hidden;
        }

        /* Standard Header */
        header {
            width: 100%;
            border-bottom: 1px solid var(--border-color);
            background: rgba(255, 255, 255, 0.5);
            z-index: 100;
            display: flex;
            justify-content: center;
            padding: 20px 0;
        }

        .header-content {
            width: 100%;
            max-width: var(--max-width);
            display: flex;
            justify-content: space-between;
            align-items: center;
            padding: 0 20px;
        }

        h1 {
            font-size: 1rem;
            font-weight: 400;
            margin: 0;
            letter-spacing: -0.02em;
        }

        nav a {
            color: var(--text-primary);
            text-decoration: none;
            margin-left: 20px;
            font-size: 0.9rem;
        }

        nav a.active {
            font-weight: 400;
            border-bottom: 1px solid var(--text-primary);
        }



        #map-container {
            flex: 1;
            width: 100%;
            height: 100%;
            position: relative;
            background-color: var(--bg-color);
            z-index: 1;
        }

        /* Pins */
        .pin {
            fill: #78B7B1;
            stroke: #ffffff;
            stroke-width: 1px;
            cursor: pointer;
            transition: r 0.2s ease;
        }

        .pin:hover {
            fill: #26a69a;
        }


        .country {
            fill: var(--bg-color);
            stroke: black;
            stroke-width: 1.5px;
            stroke-linejoin: round;
        }

        .state {
            fill: none;
            stroke: #888;
            stroke-width: 0.5px;
            stroke-linejoin: round;
        }

        #loading {
            position: absolute;
            top: 50%;
            left: 50%;
            transform: translate(-50%, -50%);
            font-size: 1.2rem;
            color: var(--text-primary);
            background: var(--user-msg-bg);
            padding: 20px;
            border: 1px solid var(--border-color);
            border-radius: 0;
            pointer-events: none;
            font-family: var(--font-family);
            z-index: 20;
        }

        #tooltip {
            position: absolute;
            display: none;
            background: white;
            color: black;
            padding: 10px;
            border: 1px solid black;
            font-size: 0.9rem;
            max-width: 300px;
            pointer-events: auto;
            z-index: 50;
            box-shadow: 2px 2px 5px rgba(0, 0, 0, 0.2);
        }
    </style>
</head>

<body>
    <header>
        <div class="header-content">
            <h1>South Asian Performing Arts</h1>
            <nav>
                <a href="chat.html">Chat</a>
                <a href="map.html" class="active">Map</a>
                <a href="citations.html">Citations</a>
            </nav>
        </div>
    </header>
    <div id="map-container">
        <div id="loading">Loading Map...</div>
        <div id="tooltip"></div>
    </div>

            .append("svg")
            .attr("width", "100%")
            .attr("height", "100%")
            .attr("viewBox", [0, 0, width, height]);

        const g = svg.append("g");

        // Zoom capability
        const zoom = d3.zoom()
            .scaleExtent([1, 20]) // Increased zoom level
            .on("zoom", (event) => {
                g.attr("transform", event.transform);
                g.selectAll(".country").style("stroke-width", 0.8 / event.transform.k + "px");
                g.selectAll(".state").style("stroke-width", 0.5 / event.transform.k + "px");
                g.selectAll(".pin")
                    .attr("r", 5 / event.transform.k)
                    .style("stroke-width", 1 / event.transform.k + "px");
            });

        svg.call(zoom);

        // Tooltip interaction variables
        let tooltipTimeout;
        const tooltipEl = document.getElementById("tooltip");

        tooltipEl.addEventListener('mouseenter', () => {
            clearTimeout(tooltipTimeout);
        });

            tooltipEl.style.display = "none";

        try {
            const countries = mapData.countries.features;
            const states = mapData.states.features;

            if (!countries || countries.length === 0) {
                throw new Error("No country data found");
            }

            const projection = d3.geoMercator();

            // Fit projection to countries
            const combinedGeoJSON = {
                type: "FeatureCollection",
                features: countries
            };

            projection.fitExtent([[50, 50], [width - 50, height - 50]], combinedGeoJSON);

            const path = d3.geoPath().projection(projection);

            // Draw Countries
            g.selectAll("path.country")
                .data(countries)
                .enter().append("path")
                .attr("class", "country")
                .attr("d", path)
                .style("fill", "white")
                .style("stroke-width", "0.8px");

            // Draw States
            g.selectAll("path.state")
                .data(states)
                .enter().append("path")
                .attr("class", "state")
                .attr("d", path)
                .style("stroke-width", "0.5px")
                .raise();

            // Draw Pins
            g.selectAll("circle.pin")
                .data(musicData)
                .enter().append("circle")
                .attr("class", "pin")
                .attr("cx", d => projection([d.lng, d.lat])[0])
                .attr("cy", d => projection([d.lng, d.lat])[1])
                .attr("r", 5)
                .style("fill", "#78B7B1")
                .style("stroke", "black")
                .style("stroke-width", 1)
                .style("cursor", "pointer")
                .on("mouseover", (event, d) => {
                    clearTimeout(tooltipTimeout);
                    const tooltip = document.getElementById("tooltip");
                    tooltip.style.display = "block";

                    const titleHtml = `<div style="font-weight: 400; margin-bottom: 5px; font-size: 1.1em;">${d.genre}</div>`;
                    const locHtml = `<div style="font-size: 0.9em; margin-bottom: 8px;">${d.loc}, ${d.state}</div>`;
                    const videoContainerId = "yt-player-container";
                    // Use a placeholder div for the API to replace
                    const videoHtml = d.videoId ? `<div id="${videoContainerId}" style="margin-bottom: 8px; height: 157px; width: 100%; display: flex; justify-content: center; align-items: center;"></div>` : "";
                    const summaryHtml = `<div>${d.summary}</div>`;

                    tooltip.innerHTML = titleHtml + locHtml + videoHtml + summaryHtml;

                    if (d.videoId && ytApiReady) {
                        // Cleanup previous instance if it exists (safety check)
                        if (ytPlayer) {
                            try { ytPlayer.destroy(); } catch (e) { }
                            ytPlayer = null;
                        }

                        // Delay slightly to ensure DOM is ready
                        setTimeout(() => {
                            if (document.getElementById(videoContainerId)) {
                                ytPlayer = new YT.Player(videoContainerId, {
                                    height: '157',
                                    width: '280',
                                    videoId: d.videoId,
                                    host: 'https://www.youtube-nocookie.com',
                                    playerVars: {
                                        'playsinline': 1,
                                        'origin': window.location.origin
                                    }
                                });
                            }
                        }, 10);
                    }


                    // Calculate positioning with edge detection
                    const tooltipWidth = tooltip.offsetWidth;
                    const tooltipHeight = tooltip.offsetHeight;
                    const viewportWidth = window.innerWidth;
                    const viewportHeight = window.innerHeight;
                    const scrollX = window.scrollX;
                    const scrollY = window.scrollY;

                    // Initial position (bottom-right of cursor)
                    let left = event.pageX + 15;
                    let top = event.pageY + 15;

                    // Check horizontal overflow (right edge)
                    if (left + tooltipWidth > viewportWidth + scrollX) {
                        left = event.pageX - 15 - tooltipWidth;
                    }

                    // Check vertical overflow (bottom edge)
                    if (top + tooltipHeight > viewportHeight + scrollY) {
                        top = event.pageY - 15 - tooltipHeight;
                    }

                    // Apply calculated position
                    tooltip.style.left = left + "px";
                    tooltip.style.top = top + "px";
                })
                .on("mouseout", () => {
                    tooltipTimeout = setTimeout(() => {
                        const tooltip = document.getElementById("tooltip");
                        tooltip.style.display = "none";
                        tooltip.innerHTML = "";
                        if (typeof ytPlayer !== 'undefined' && ytPlayer) {
                            try { ytPlayer.destroy(); } catch (e) { }
                            ytPlayer = null;
                        }
                    }, 300);
                });

            document.getElementById("loading").style.display = "none";

        } catch (err) {
            console.error("Error rendering map:", err);
            document.getElementById("loading").innerHTML = "Error loading map: " + err.message;
            document.getElementById("loading").style.color = "red";
        }

    </script>
